import * as React from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';




const Post = () => {
    return (

        <Box
      component="form"
      sx={{
        '& .MuiTextField-root': { m: 1, width: '50%'},
      }}
      noValidate
      autoComplete="off"
    >
      <div>
       
        <TextField
    
          id="outlined-multiline-static"
          color="black"
          label="Publique o que quiser"
          multiline
          rows={4}
        />
      
      </div>
    </Box>
        
        )
}

export default Post
